  false,\n\t\"url\": null,\n\t\"notes\": \"Time series datasets collected by the USGS
  Coastal and Marine Geology Program from 1975 to the present. The data were collected
  to address specific research questions and were primarily collected over durations
  less than a year, using stationary platforms, with sensors near the sea floor. Some
  of the measurements span the vertical extent of the water column, but others are
  limited to the area less than 5 meters above the sea floor. These data have been
  used to study of ocean dynamics and to validate coastal ocean models.\",\n\t\"owner_org\":
